Q.u("tig-filters",'ObservableValue<Boolean> chipsPresent = ov(true);\nObservableValue<Boolean> textEntered = ov(false);\n\nTextInputGroup textInputGroup = textInputGroup();\nChipGroup chipGroup = chipGroup();\nCloseHandler<Chip> closeHandler = (event, chip) -> chipsPresent.set(!chipGroup.isEmpty());\nchipGroup.addItems(asList("one", "two", "three", "four", "five", "six", "seven", "eight", "nine", "ten",\n        "eleven", "twelve"), text -> chip(text).onClose(closeHandler));\n\ntextInputGroup\n        .addMain(textInputGroupMain("tig-filters-0")\n                .addChipGroup(chipGroup)\n                .placeholder("Placeholder")\n                .onChange((e, tig, value) -> {\n                    textEntered.set(!value.isEmpty());\n                    if (Key.Enter.match(e) && !value.isEmpty()) {\n                        chipGroup.addItem(chip(value).onClose(closeHandler));\n                        tig.main().value("");\n                        chipsPresent.set(true);\n                        textEntered.set(false);\n                    }\n                }))\n        .addUtilities(textInputGroupUtilities(false)\n                .add(button().icon(times()).plain()\n                        .on(click, e -> {\n                            chipGroup.clear();\n                            textInputGroup.main().value("");\n                            chipsPresent.set(false);\n                            textEntered.change(false);\n                        })));\n\nchipsPresent.subscribe((current, previous) -> {\n    setVisible(chipGroup, current);\n    if (current) {\n        textInputGroup.main().removeIcon();\n    } else {\n        textInputGroup.main().icon(search());\n        setVisible(textInputGroup.utilities(), textEntered.get());\n    }\n});\ntextEntered.subscribe((current, previous) -> {\n    if (current) {\n        setVisible(textInputGroup.utilities(), true);\n    } else {\n        setVisible(textInputGroup.utilities(), chipsPresent.get());\n    }\n});\n\nreturn div()\n        .add(textInputGroup)\n        .element();');
Q.u("form-select-basic",'String[] values = {"Mr", "Miss", "Mrs", "Ms", "Dr", "Other"};\nreturn div()\n        // if not specified, Id.build(<label>) is used as a value\n        .add(formSelect("basic-form-select-0", Id.build("Mrs"))\n                .addOption(formSelectOption("Select one").placeholder())\n                .addOptions(asList(values), FormSelectOption::formSelectOption))\n        .element();');Q.u("form-select-validated",'final double[] handle = {0};\nHelperText helperText = helperText("");\nFormSelect formSelect = formSelect("validated-form-select-0")\n        .onChange((e, fs, value) -> {\n            clearTimeout(handle[0]);\n            fs.validated(default_);\n            helperText.firstItem()\n                    .status(default_)\n                    .text("Validating...");\n            int number = Integer.parseInt(value);\n            handle[0] = setTimeout(__ -> {\n                if (number == 0) {\n                    fs.validated(warning);\n                    helperText.firstItem()\n                            .status(warning)\n                            .text("You must have select a value");\n                } else if (number == 3) {\n                    fs.validated(success);\n                    helperText.firstItem()\n                            .status(success)\n                            .text("You chose wisely");\n                } else {\n                    fs.validated(error);\n                    helperText.firstItem()\n                            .status(error)\n                            .text("You must chose Three (thought that was obvious)");\n                }\n            }, 1234);\n        });\nreturn div()\n        .add(form()\n                .add(formGroup()\n                        .addLabel(formGroupLabel("Comments:"))\n                        .addControl(formGroupControl()\n                                .addControl(formSelect\n                                        .addOption(formSelectOption("Select a number", "0")\n                                                .placeholder(true))\n                                        .addOption(formSelectOption("One", "1"))\n                                        .addOption(formSelectOption("Two", "2"))\n                                        .addOption(formSelectOption("Three - the only valid option", "3")))\n                                .addHelperText(helperText))))\n        .element();');
Q.u("form-select-disabled",'String[] values = {"Mr", "Miss", "Mrs", "Ms", "Dr", "Other"};\nreturn div()\n        .add(formSelect("disabled-form-select-0", Id.build("Mrs")).disabled()\n                .addOption(formSelectOption("Select one").placeholder())\n                .addOptions(asList(values), FormSelectOption::formSelectOption))\n        .element();');Q.u("form-select-grouped",'div()\n        .add(formSelect("disabled-form-select-0", "2")\n                .addGroup(formSelectOptionGroup("Group 1")\n                        .addOption(formSelectOption("The first option", "1"))\n                        .addOption(formSelectOption("Second option is selected by default", "2")))\n                .addGroup(formSelectOptionGroup("Group 2")\n                        .addOption(formSelectOption("The third option", "3"))\n                        .addOption(formSelectOption("The fourth option", "4")))\n                .addGroup(formSelectOptionGroup("Group 3").disabled()\n                        .addOption(formSelectOption("The fifth option", "5"))\n                        .addOption(formSelectOption("The sixth option", "6"))))\n        .element()');
